import React from 'react';
import { Text, View, Image,SafeAreaView,ScrollView,TouchableOpacity } from 'react-native';
import { SearchBar } from 'react-native-elements';
import {styles} from '../providerStyle';
import {data} from './data';

export default function PendingOrder() {
  let orders = (
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Image
      style = {styles.finishImg}
      source = {require('../../images/providerImg/order_img_finish.png')}
      />
     <Text style={{ color: '#333333', fontSize: 16, fontWeight: '400'}}>您还没有完成的订单哦，快去完成吧！</Text>
     </View>
  );
  if (data.length >0) {
  orders = data.map((item) => {
    return (
      <View style={styles.card}>
        <Text>{item.name}</Text>
        <Text>{item.address}</Text>
        <Text>{item.time}</Text>
        <Text>{item.price}</Text>
        <View style={{flexDirection: 'row-reverse'}}>
          <TouchableOpacity style={styles.orderButton2}>
            <Text style={{fontSize:14, color:'#FAFAFA'}}>接受</Text>
          </TouchableOpacity>
          <TouchableOpacity style={styles.orderButton}>
            <Text style={{fontSize:14, color:'#FAFAFA'}}>拒绝</Text>
          </TouchableOpacity>
        </View>
      </View>
    )
  });
  }
  return (
    <SafeAreaView style={{ flex:1, justifyContent: "center", alignItems: "center" }}>
      <ScrollView style={{ flex:1,}}>
        {orders}
      </ScrollView>
    </SafeAreaView>
  );
}
